  [],\n\t\"revision_timestamp\": \"2016-07-27T23:05:59.180724\",\n\t\"name\": \"pacific-remote-islands-mnm-initial-survey-instructions-for-pelagic-wildlife\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The estimated millions of seabirds breeding
  at national wildlife refuges in the central Pacific Ocean are primarily pelagic
  feeders that obtain the fish and squid they consume by associating with schools
  of large predatory fish such as tuna and billfish. While both the predatory fish
  and the birds are capable of foraging throughout their pelagic ranges (which encompass
  the tropical Pacific Ocean), the birds are most successful at feeding their young
  when they can find schools of predatory fish within easy commuting range of the
  breeding colonies. Recently fledged birds, which are inexperienced in this complex
  and demanding style of foraging, rely on abundant and local food resources to survive
  while they learn to locate and capture prey. Assessing pelagic seabird populations
  in conjunction with their use of the terrestrial habitat at Howland provides a more
  comprehensive picture of their abundance and activity status than terrestrial surveys
  alone. Little is known of marine mammal use surrounding Howland Island, although
  it is known that some species are found in the vicinity. Only anecdotal information
  exists on marine mammal use of the waters surrounding Howland Island. Studies elsewhere
  in the Pacific, however, indicate that waters surrounding small islands may support
  distinct local populations of marine mammals. Given the remoteness of Howland and
  infrequency of access, formal surveys of marine mammal distribution and abundance
  have not been undertaken at the Refuge.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
